    "summary": "Thanks for visiting my Patreon Account! I really mean that. I post some extra stuff on here that I don\u0027t post on my Youtube page. It\u0027s usually the videos that I post on youtube but at regular speed. There are also some videos that have the original audio, or videos that I made mistakes on and a few pictures.\u003cbr\u003e\u003cbr\u003eI started a Youtube channel with my family in July 2016 and I noticed that people were interested in my flexibility. That\u0027s when I decided to create a new channel and TBB Uncensored was born. I chose that name because my other channel is named The Brandy Bunch (My name is Brandy and I have 6 kids). My plan was to just upload my workouts and throw some music in the background. I wasn\u0027t going to edit them much so I threw uncensored on the end. \u003cbr\u003e\u003cbr\u003eI am flexible because I have a connective tissue disorder called Ehlers-Danlos Syndrome. It causes all of those weird bruises you see. I have to change the workouts I do all of the time because I am always hurting myself and have to avoid using certain body parts until they heal. Fitness has never really been my thing and it is kind of funny how all this has worked out. I have only taken a handful of yoga classes in my life and I am in no way an expert. So don\u0027t mind me if I do don\u0027t get my yoga poses quite right. lol \u003cbr\u003e\u003cbr\u003eI\u0027m just a mom.\u003cbr\u003e\u003cbr\u003eBecome a Patron so I can make some more videos :-) Even $1 would make me smile. \u003cbr\u003e\u003cbr\u003eThank you for being here. Thanks for making me work out.\u003cbr\u003e\u003cbr\u003eI made an Amazon wishlist just in case you would like to get me an outfit for my videos.\u003cbr\u003e\u003cbr\u003eAmazon Wish List\u003cbr\u003e\u003ca href=\"https://www.amazon.com/gp/aw/ls/ref=cm_sw_em_r_z_g__wb?ie=UTF8\u0026amp;lid=1666C8U8IGV22\u0026amp;ref_=cm_sw_em_r_z_g__wb\u0026amp;ty=wishlist\"\u003ehttps://www.amazon.com/gp/aw/ls/ref=cm_
